    case serverDataException
    // 鉴权失败，错误码@%:,错误信息:@%
    case serverInspectError(errorDesc: String, errorCode: String)

    public var bizDomain: Int { 26 }
    public var funcDomain: Int { 1 }

    public var rawValue: Int {
        switch self {
        case .serverDataException:
            return 1
        case .serverInspectError:
            return 2
        }
    }
    
    public var errString: String {
